// Function 1: Get array of types for a given tab (Boy/Girl)
export function getTypesByTab(tab) {
    const tabItem = gridData.find(item => item.tab === tab);
    return tabItem ? tabItem.tabData.map(item => item.type) : [];
}

// Function 2: Get themes by type for a given tab (Boy/Girl)
export function getThemesByTabAndType(tab, type) {
    const tabItem = gridData.find(item => item.tab === tab);
    if (!tabItem) return [];
    const typeItem = tabItem.tabData.find(item => item.type === type);
    return typeItem ? typeItem.typeData.map(t => t.theme) : [];
}

// Function: Get theme data by tab, type, and theme
export function getThemeDataByTabAndTheme(tab, type, theme) {
    const tabItem = gridData.find(item => item.tab === tab);
    if (!tabItem) return [];
    const typeItem = tabItem.tabData.find(item => item.type === type);
    if (!typeItem) return [];
    const themeItem = typeItem.typeData.find(t => t.theme === theme);
    return themeItem ? themeItem.themeData : [];
}